import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="bg-gray-900 text-white px-6 py-4 flex justify-between items-center">
      <div className="text-2xl font-bold text-orange-400">eat this much</div>
      <nav className="space-x-6 hidden sm:flex">
        <Link to="/home" className="hover:underline">Home</Link>
        <Link to="/workout" className="hover:underline">Workout Plan</Link>
        <Link to="/history" className="hover:underline">History</Link>
        <Link to="/login" className="text-orange-500 hover:underline">Login</Link>
        <Link to="/register" className="bg-orange-500 px-4 py-2 rounded text-white hover:bg-orange-600">Sign Up</Link>
      </nav>
    </header>
  );
};

export default Navbar;
